import React from "react";

// reactstrap components

// core components
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import IndexHeader from "components/Headers/IndexHeader.js";
import DemoFooter from "components/Footers/DemoFooter.js";

// index sections

import SectionMarkdown from "./index-sections/SectionMarkdown";
import SectionTypo from "./index-sections/SectionTypo";
import RegisterPage from "./examples/RegisterPage";
import NucleoIcons from "./NucleoIcons";
import LandingPage from "./examples/LandingPage";
import LandingPageHeader from "../components/Headers/LandingPageHeader";
import Ch01 from "./echarts-sections/Ch01";
import ProfilePage from "./examples/ProfilePage";
import ProfilePageHeader from "../components/Headers/ProfilePageHeader";
import Ch02 from "./echarts-sections/Ch02";

function Index() {
  document.documentElement.classList.remove("nav-open");
  React.useEffect(() => {
    document.body.classList.add("index");
    return function cleanup() {
      document.body.classList.remove("index");
    };
  });
  return (
    <>
      <IndexNavbar />
      <IndexHeader />
      <div className="main">
          <SectionTypo />
          <Ch01 />
          <Ch02 />
          <Ch03 />
          <Ch04 />
          <RegisterPage />
      </div>
    </>
  );
}

export default Index;
